-- Verifica consistencia: elimina transacciones de servicios en estado "Solicitado"
DELETE FROM transacciones 
WHERE id_servicio IN (
	SELECT id_servicio FROM servicios WHERE id_estado = 1
);

-- Verifica consistencia: Actualiza fecha_anulacion de transacciones en donde la fecha es mayor a la fecha_anulacion
UPDATE transacciones
SET fecha_anulacion = DATE_ADD(fecha, INTERVAL 1 DAY)
WHERE fecha > fecha_anulacion;

-- Verifica consistencia: Actualiza fecha transacciones que se realizaron antes de que se apruebe el servicio
UPDATE transacciones AS t
INNER JOIN servicios AS s
	ON t.id_servicio = s.id_servicio
SET t.fecha = DATE_ADD(s.fecha_aprobacion, INTERVAL 1 DAY)
WHERE t.fecha < s.fecha_aprobacion;

